import React from 'react';

const Navigation = ({ navigation }) => (
  <ul className="navigation">
    {navigation.map((item) => {
      const { name, url } = item;
      return (
        <li>
          <a href={url}>{name}</a>
        </li>
      );
    })}
  </ul>
);

export default Navigation;
